import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Insights = () => {
  const [entries, setEntries] = useState([]);
  const [strategies, setStrategies] = useState([]);

  const defaultEntries = [
    {
      text: "I'm feeling overwhelmed and stressed with all the tasks at work. I can't catch a break, and it feels like it's too much.",
      metadata: { keywords: ["overwhelmed", "stressed", "work", "too much", "burnout"] },
      mediaAnalysis: { labels: ["Negative"], texts: ["Frustrated", "Burnout"] }, // Negative sentiment
    },
    {
      text: "It's been a tough week. Struggling with personal issues, feeling a bit lost and overwhelmed.",
      metadata: { keywords: ["tough", "personal", "struggling", "overwhelmed"] },
      mediaAnalysis: { labels: ["Negative"], texts: ["Frustrated", "Stressed"] }, // Negative sentiment
    },
    {
      text: "Work was okay today. Not much happened, just the usual. Nothing too exciting or frustrating.",
      metadata: { keywords: ["work", "usual", "okay", "average"] },
      mediaAnalysis: { labels: ["Negative"], texts: ["Indifferent", "Stressed"] }, // Negative sentiment
    },
  ];

  useEffect(() => {
    setEntries(defaultEntries);
    fetchStrategies();
  }, []);

  const fetchStrategies = async () => {
    try {
      const response = await axios.post(
        `${API_URL}/api/strategies`,
        { sentiment: 'negative' },
        { headers: { 'Content-Type': 'application/json' } }
      );
      if (response.data && response.data.strategies) {
        setStrategies(response.data.strategies);
      }
    } catch (error) {
      console.error('Error fetching strategies:', error);
    }
  };

  return (
    <div>
      <h1>Sentiment Insights</h1>
      <div>
        {entries.map((entry, index) => (
          <div key={index}>
            <p>{entry.text}</p>
            <p>Keywords: {entry.metadata.keywords.join(", ")}</p>
            <p>Sentiment: {entry.mediaAnalysis.texts.join(", ")}</p>
          </div>
        ))}
      </div>

      <div>
        <h2>Suggested Strategies for Negative Sentiment</h2>
        {strategies.length > 0 ? (
          <ul>
            {strategies.map((strategy, index) => (
              <li key={index}>{strategy}</li>
            ))}
          </ul>
        ) : (
          <p>Loading strategies...</p>
        )}
      </div>
    </div>
  );
};

export default Insights;
